package com.ke.springcloud;import org.springframework.boot.SpringApplication;import org.springframework.boot.autoconfigure.SpringBootApplication;import org.springframework.cloud.client.discovery.EnableDiscoveryClient;import org.springframework.cloud.netflix.eureka.server.EnableEurekaServer;/** * @author stephen 2022/8/4 23:51 */@SpringBootApplication@EnableEurekaServer@EnableDiscoveryClientpublic class SpringCloudEurekaServer7001Application {	public static void main(String[] args) {		SpringApplication.run(SpringCloudEurekaServer7001Application.class, args);	}}